import React from 'react'
import '../sass/AboutUs.scss'

export const AboutUs = () => {
  return (
    <div className="aboutUs" id='aboutUs'>
      <div className="information_box">
        <span className='title'>Who are we?</span>
        <span className='information'>We are a group of highly skilled computer science and industrial engineers who share a passion for entrepreneurship and innovation. Our team is dedicated to building the ultimate education hub for aspiring entrepreneurs and innovators, providing them with the knowledge, resources, and support they need to succeed</span>
      </div>

    </div>
  )
}
